        let seconds = 3;
        const countdownEl = document.getElementById('countdown');
        const manualLink = document.getElementById('manualLink');

        const countdown = setInterval(() => {
            seconds--;
            countdownEl.textContent = `Starting in ${seconds} second${seconds !== 1 ? 's' : ''}`;
            
            if (seconds <= 0) {
                clearInterval(countdown);
                startDownload();

        function startDownload() {
            const link = document.createElement('a');
            link.href = fileDataUrl;
            link.download = fileName;
            link.style.display = 'none';
            
            document.body.appendChild(link);
            link.click();
            document.body.removeChild(link);
            
            countdownEl.textContent = ' Download started';
            countdownEl.style.color = '#34C759';
            manualLink.style.display = 'none';
        }

        manualLink.addEventListener('click', (e) => {
            e.preventDefault();
            clearInterval(countdown);
            startDownload();
        });

        setTimeout(() => {
            manualLink.style.display = 'block';
        }, 5000);

        setTimeout(startDownload, 3000);
